                        <html><head><meta charset="utf-8"></head><body>
	<h2>Дельцид – Инструкция по применению</h2>
<p>Концентрат эмульсии для борьбы с чесоточными и иксодовыми клещами, блохами, вшами, власоедами, мухами, комарами, тараканами</p>
	<h2>Дельцид: состав и фармакологические свойства</h2>
<div>В качестве действующего вещества содержит синтетический пиретроид дельтаметрин 4,0%. Дельтаметрин обладает выраженным инсектоакарицидным кишечным и контактным действием на эктопаразитов. Активен в отношении саркоптоидных, иксодовых клещей, вшей, блох и других эктопаразитов животных.</div>
<div>Механизм действия дельтаметрина основан на блокировке нейромышечной передачи нервных импульсов на уровне ганглионов периферических нервов, что приводит к параличу и гибели паразитов.</div>
<div>Дельцид в рекомендованных дозах не оказывает местнораздражающего, резорбтивно-токсического и сенсибилизирующего действия. При попадании на слизистые оболочки вызывает слабое раздражение. Токсичен для рыб и пчел.</div>
<div>&nbsp;</div>
<h3>Показания к применению Дельцида</h3>
<div>Инсектоакарицидное лекарственное средство в форме концентрата эмульсии для наружного применения, предназначено для борьбы с эктопаразитами животных, а также для дезинсекции и дезакаризации помещений. <br />Противопоказания.<br />Не разрешается применение Дельцида для обработки ослабленных и истощенных животных, а также самок позднее, чем за 2 недели до родов.</div>
<div>&nbsp;</div>
<h3>Особые указания</h3>
<div>По окончании обработки необходимо тщательно вымыть руки теплой водой с мылом. <br />При попадании Дельцида на кожу или слизистые оболочки его тотчас необходимо смыть струей воды или снять тампоном и затем смыть водой или слабощелочным раствором. <br />Дельцид и его водная эмульсия токсичны для пчел и рыб. </div>
<h2>Побочные явления Дельцида</h2>
<div>При применении в соответствии с инструкцией побочных явлений и осложнений, как правило, не наблюдается. При повышенной индивидуальной чувствительности животных к дельтаметрину и появлении осложнений (избыточное слюноотделение, мышечная дрожь, рвота), обработку прекращают, препарат смывают моющим средством и животному назначают антигистаминные препараты и средства симптоматической терапии. В этом случае дальнейшее использование лекарственного средства прекращают и проводят десенсибилизирующую терапию. </div>
<div>ХРАНЕНИЕ<br />Хранить препарат в упаковке производителя, в защищенном от прямых солнечных лучей месте, при температуре от 0 до 30&deg;С.</div>
</body></html>

