                        <html><head><meta charset="utf-8"></head><body>
<p>Животных короткошерстных пород опрыскивают водной эмульсией Дельцида, длинношерстных - купают в водной эмульсии препарата.</p>
<p>Препарат растворяют в прохладной водопроводной воде в следующих концентрациях:</p>
<p>Обработка животных опрыскиванием или купанием.</p>
<p>Иксодовые и чесоточные клещи ( в т. ч. демодекс), вши, блохи,власоеды, мухи, слепни, гнус- <br />1 доза на 1,6 л воды с профилактической целью &ndash; однократно. С лечебной &ndash; 2-х, 3-х кратно с интервалом в 7-10 дней. Обрабатывают пораженные участки, с захватом по периметру очага 1-2 см здоровой кожи. Интервал 7 дней до получения 2-х отрицательных заключений исследования соскобов.</p>
<p>Опрыскивание помещений, где содержатся животные</p>
<table class="table  table-delivery">
<tbody>
<tr>
<th class="null">Пористая поверхность</th>
<th class="null">Гладкая поверхность</th>
</tr>
<tr>
<td class="null">Против мух, клещей, клопов, тараканов, муравьев, блох&nbsp; 1 ампула (1 доза) на 1,6 л воды 1 л раствора&nbsp;&nbsp; на 10 м2 поверхности</td>
<td class="null">1 доза/ 1л воды 0,5 л раствора на 10 м2 поверхности</td>
</tr>
</tbody>
</table>
<p>&nbsp;</p>
<p>После обработки дать поверхности высохнуть. Помещение обязательно проветрить.</p>
<p>Последовательность опрыскивания животного: ушные раковины, го- лова, тело, хвост, область вокруг анального отверстия, конечности с нормой расхода 5-10 мл/кг массы. При обработке не допускать попадания эмульсии в глаза, нос и рот животного.</p>
<p>Смочить шерсть животного и дать ей высохнуть. Для предотвращения слизывания препарата животным надевают намордник или смыкают челюсти петлей из тесьмы, которые снимают через 15-20 минут после обработки. Не рекомендуется купать животное с шампунем за 3 дня до, и 3 дня после обработки. Использовать следует только свежеприготовленную эмульсию!</p>
<p>Обработку собак при саркоптозе проводят 2-3 кратно с интервалом 7-10 дней до клинического выздоровления животного, подтверждённого двумя отрицательными результатами акарологических исследований, при энтомозах - по показаниям. </p>
</body></html>
